import React from "react";
import "./InputText.css";

interface InputTextProps {
  id: string;
  placeholder?: string;
  value: string;
  onChange: (e: React.ChangeEvent<HTMLInputElement>) => void;
  size?: "small" | "medium" | "large";
  quiet?: boolean;
  disabled?: boolean;
}

const InputText: React.FC<InputTextProps> = ({
  id,
  placeholder,
  value,
  onChange,
  size = "medium",
  quiet = false,
  disabled = false,
}) => {
  return (
    <input
      id={id}
      type="text"
      placeholder={placeholder}
      value={value}
      onChange={onChange}
      className={`input-text ${size} ${quiet ? "quiet" : ""}`}
      disabled={disabled}
    />
  );
};

export default InputText;
